import { useMemo } from "react";
import "./ListRow2.css";

const ListRow2 = ({
  prop,
  propPadding,
  propBackgroundColor,
  propWidth,
  propDisplay,
  propMinWidth,
  propFlex,
}) => {
  const submitStyle = useMemo(() => {
    return {
      padding: propPadding,
      backgroundColor: propBackgroundColor,
      width: propWidth,
    };
  }, [propPadding, propBackgroundColor, propWidth]);

  const b5Style = useMemo(() => {
    return {
      display: propDisplay,
      minWidth: propMinWidth,
      flex: propFlex,
    };
  }, [propDisplay, propMinWidth, propFlex]);

  return (
    <div className="list-row1">
      <button className="submit15" style={submitStyle}>
        <b className="b223" style={b5Style}>
          {prop}
        </b>
      </button>
      <div className="div277">
        <p className="p179">3주차 과제</p>
        <p className="p180">2</p>
        <p className="p181">3</p>
      </div>
      <div className="div278">3 주차</div>
      <div className="div279">24-03-24 23:59</div>
      <div className="div280">-</div>
    </div>
  );
};

export default ListRow2;
